import React from 'react';
import './App.css';

//import components
import Nav from './Components/Nav';
import Search from './Components/Search';
import Gallery from './Components/Gallery';
import NoResults from './Components/NoResults';

const App = () => (
    <div className="container">
      <Nav />
      <Search />
      <Gallery> 
        <NoResults />
      </Gallery>
    </div>
  );

export default App;
